export const CardChildComponent = (props) => {
    return (
        <div style={{display:'flex', flexDirection:'column', backgroundColor:'GrayText', justifyContent:'center'}}>
            <div style={{display:'flex', justifyContent:'left', alignContent:'center'}}><h1>{props.fruits.name}</h1></div>
            <h2>{props.fruits.color}</h2>
            <p>{props.fruits.taste}</p>
            <div><img src={props.fruits.img} width={200} height={100} /></div>
        </div>
    );
}
